// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

contract DonorNFT is ERC721, Ownable {
    uint256 public tokenCounter;
    mapping(uint8 => string) public tierTokenURIs; // Tier mappings: 1=Bronze, 2=Silver, 3=Gold
    mapping(uint256 => uint8) private tokenTiers; // Token ID -> Tier ID mapping

    constructor() ERC721("DonorNFT", "DNFT") Ownable(msg.sender) {
    tokenCounter = 0;
    // Replace these with actual metadata links
    tierTokenURIs[1] = "https://drive.google.com/file/d/1DopXnUXE3zgD8g9IiMnhaOY6c_xdEfLG/view?usp=sharing";
    tierTokenURIs[2] = "https://drive.google.com/file/d/1gNfZXQ1wXrPJ1tHa045eeilcNbyjPWCY/view?usp=sharing";
    tierTokenURIs[3] = "https://drive.google.com/file/d/1qmZNQaCG3E7URiXh7egmJJk9293tYNsX/view?usp=sharing";
}

    function mintTieredNFT(address recipient, uint8 tierId) external onlyOwner returns (uint256) {
        require(tierId >= 1 && tierId <= 3, "Invalid tier");
        tokenCounter += 1;
        uint256 newTokenId = tokenCounter;
        _safeMint(recipient, newTokenId);
        tokenTiers[newTokenId] = tierId; // Assign tier to token
        return newTokenId;
    }

   function tokenURI(uint256 tokenId) public view override returns (string memory) {
    require(ownerOf(tokenId) != address(0), "URI query for nonexistent token");
    uint8 tierId = tokenTiers[tokenId];
    return tierTokenURIs[tierId];
}

function getTokenTier(uint256 tokenId) external view returns (uint8) {
    require(ownerOf(tokenId) != address(0), "Nonexistent token");
    return tokenTiers[tokenId];
}

function setTokenTier(uint256 tokenId, uint8 tierId) external onlyOwner {
    require(ownerOf(tokenId) != address(0), "Nonexistent token");
    require(tierId >= 1 && tierId <= 3, "Invalid tier");
    tokenTiers[tokenId] = tierId;
}
}
